void OAIDaemonApi::mgetInfo(const QList<QString> &info_array) {
    QString fullPath = QString(_serverConfigs["mgetInfo"][_serverIndices.value("mgetInfo")].URL()+"/mimic/mget/{infoArray}");
    
    if (!_username.isEmpty() && !_password.isEmpty()) {
        QByteArray b64;
        b64.append(_username.toUtf8() + ":" + _password.toUtf8());
        addHeaders("Authorization","Basic " + b64.toBase64());
    }
    
    {
        QString info_arrayPathParam("{");
        info_arrayPathParam.append("infoArray").append("}");
        QString pathPrefix, pathSuffix, pathDelimiter;
        QString pathStyle = "simple";
        if (pathStyle == "")
            pathStyle = "simple";
        pathPrefix = getParamStylePrefix(pathStyle);
        pathSuffix = getParamStyleSuffix(pathStyle);
        pathDelimiter = getParamStyleDelimiter(pathStyle, "infoArray", false);
        if (info_array.size() > 0) {
            QString paramString = (pathStyle == "matrix") ? pathPrefix+"infoArray"+pathSuffix : pathPrefix;
            qint32 count = 0;
            for (QString t : info_array) {
                if (count > 0) {
                    fullPath.append(pathDelimiter);
                }
                fullPath.append(QUrl::toPercentEncoding(::OpenAPI::toStringValue(t)));
                count++;
            }
            fullPath.replace(info_arrayPathParam, paramString);
        }
    }
    OAIHttpRequestWorker *worker = new OAIHttpRequestWorker(this, _manager);
    worker->setTimeOut(_timeOut);
    worker->setWorkingDirectory(_workingDirectory);
    OAIHttpRequestInput input(fullPath, "GET");


    for (auto keyValueIt = _defaultHeaders.keyValueBegin(); keyValueIt != _defaultHeaders.keyValueEnd(); keyValueIt++) {
        input.headers.insert(keyValueIt->first, keyValueIt->second);
    }


    connect(worker, &OAIHttpRequestWorker::on_execution_finished, this, &OAIDaemonApi::mgetInfoCallback);
    connect(this, &OAIDaemonApi::abortRequestsSignal, worker, &QObject::deleteLater);
    connect(worker, &QObject::destroyed, this, [this]() {
        if (findChildren<OAIHttpRequestWorker*>().count() == 0) {
            Q_EMIT allPendingRequestsCompleted();
        }
    });

    worker->execute(&input);
}

